<h2 id="1-faire-sa-carte-grise-en-ligne-avec-eplaque-fr">Faire sa carte grise en ligne avecDocumentsofficiels.fr</h2>



<p>Depuis novembre 2017, les procédures d&rsquo;immatriculation en préfecture ont été remplacées par le système de carte grise en ligne de l&rsquo;ANTS. Il coexiste avec les services d&rsquo;immatriculation des prestataires privés habilités tels qu&rsquo;DocumentofficielsIl n&rsquo;est plus possible de se déplacer en préfecture pour effectuer son changement de carte grise au guichet.</p>



<div class="wp-block-image"><figure class="alignright size-large is-resized"><img loading="lazy" data-src="https://documentsofficiels.fr/app/App_Resources/logo-france-connect.png" alt="Logo France Connect" class="wp-image-13743" width="228" height="109"/><figcaption>documentsofficiels : habilitations n°18621 du Ministère de l’Intérieur et n°26579 du Trésor Public.
</figcaption></figure></div>



<p>documentsofficiels est&nbsp;<strong>habilité par le Ministère de l&rsquo;Intérieur</strong>&nbsp;et&nbsp;<strong>agréé par le Trésor Public</strong>&nbsp;pour effectuer vos démarches d&rsquo;immatriculation et encaisser les taxes. Service privé non affilié au gouvernement.<br><br></p>



<p>Ce service d&rsquo;immatriculation en ligne a été mis en place pour&nbsp;<strong>faciliter les démarches administratives de tou(te)s les Françai(se)s</strong>. Toutefois, vous pouvez&nbsp;utiliser le site de l&rsquo;ANTS pour&nbsp;faire votre carte grise sans frais supplémentaires.<br><br></p>



<p>Dès réception de votre demande de carte grise en ligne et de vos documents d&rsquo;immatriculation, vous recevrez un Certificat Provisoire d&rsquo;Immatriculation (CPI) par notre&nbsp;<a href="#/carte-grise/service-carte-grise.html">service carte grise</a>.<br><br></p>



<p><a href="#/carte-grise/certificat-immatriculation.html">Le certificat d&rsquo;immatriculation</a>&nbsp;original est envoyé par l&rsquo;Imprimerie Nationale sous 3 à 5 jours ouvrés par recommandé à l&rsquo;adresse qui y figure.</p>



<h2 id="2-pourquoi-faire-sa-demande-de-carte-grise-avec-eplaque">Pourquoi faire sa demande de carte grise avec documentsofficiels ?</h2>



<h3 id="3-paiement-en-2-ou-3-fois">Paiement en 2 ou 3 fois</h3>



<p>Vous avez la possibilité de payer vos taxes de&nbsp;<a href="https://documentsofficiels.fr/carte-grise.php/paiement-en-3-fois.php">carte grise en plusieurs fois</a>&nbsp;contrairement à la Préfecture.</p>



<h3 id="4-pratique">Pratique</h3>



<p>Débarrassez-vous de cette contrainte administrative, évitez les retards ou contournez les bugs en utilisant un service éprouvé depuis 2009, où tout se fait par internet <a href="#/carte-grise/demande-par-courrier.html">et par courrier.</a></p>



<h3 id="5-sans-code-de-cession-ou-code-confidentiel">Sans code de cession ou code confidentiel</h3>



<p>Vous pouvez faire toute démarche d&rsquo;immatriculation sans code confidentiel et sans code de cession.</p>



<h3 id="6-delais-garantis">Délais garantis</h3>



<p>Dès réception de vos documents, votre véhicule est immatriculé à votre nom le jour même (dossiers simples tels que changement de titulaire, demande de duplicata, etc.).</p>



<h3 id="7-paiement-par-cheque-de-la-carte-grise">Paiement par chèque de la carte grise</h3>



<p>Vous pouvez payer par carte, mais aussi par chèque.</p>



<h3 id="8-assistance-personnalisee">Assistance personnalisée</h3>



<p>Une équipe jeune et dynamique se tient à votre disposition par email et par téléphone tout au long de votre démarche pour répondre à toutes vos questions relatives à votre carte grise.</p>



<h3 id="9-aide-aux-documents">Aide aux documents</h3>



<p>Une aide complète vous est offerte sur le site d&rsquo;Documentofficiels.fr pour être certain de rassembler un dossier complet de carte grise, pour plus d&rsquo;informations rendez-vous sur notre page&nbsp;<a href="#/carte-grise/documents-carte-grise.html">documents de carte grise</a>. Un remplissage semi-automatique des documents Cerfa vous est proposé.</p>



<h2 id="10-toutes-vos-demarches-dimmatriculation-sont-prises-en-charge">Toutes vos démarches d&rsquo;immatriculation sont prises en charge</h2>



<p>documentsofficiels se charge de vos demandes de certificat d&rsquo;immatriculation simples. Mais aussi de vos <strong>dossiers complexes</strong>. Profitez de notre expérience, expertise et support client pour :</p>



<ul><li>Changement de titulaire</li><li>Demande de duplicata carte grise</li><li>Changement d&rsquo;adresse</li><li>Immatriculation d&rsquo;un véhicule neuf (tous <a href="#/carte-grise/constructeur-automobile.html">constructeurs</a>)</li><li>Enregistrement de cession</li><li>Carte grise de collection</li><li>Modification des caractéristiques techniques</li><li>Carte grise succession</li><li>Changement d&rsquo;état matrimonial</li><li>Carte grise d&rsquo;un véhicule importé</li><li><a href="#/carte-grise/certificat-provisoire-immatriculation-ww">Immatriculation &#8211; carte grise provisoire WW</a></li><li>Immatriculation garage W</li><li>Correction d&rsquo;une erreur sur la carte grise</li><li>Carte grise leasing</li><li>Changement de nom sur la carte grise</li><li>Ajout ou suppression de cotitulaire</li><li>Changement de raison sociale</li><li>Nouvelle immatriculation suite à une usurpation de plaques</li><li>Demande de fiche d&rsquo;identification d&rsquo;un véhicule</li></ul>



<h2 id="11-comment-se-deroule-votre-demande-de-carte-grise-en-ligne">Comment se déroule votre demande de carte grise en ligne ?</h2>



<div class="wp-block-image"><figure class="alignright"><img data-src="https://documentsofficiels.fr/app/App_Resources/carte-grise-siv.jpg" alt="Carte Grise SIV"/><figcaption>Carte grise</figcaption></figure></div>



<h3 id="12-calculez-le-prix-des-taxes">Calculez le prix des taxes</h3>



<p>Le&nbsp;<a href="#/carte-grise/prix-carte-grise.html">prix de la carte grise</a>&nbsp;dépend du nombre de chevaux fiscaux, du département d’habitation du titulaire, du genre du véhicule ainsi que de la date de mise en circulation du véhicule. Les Conseils Régionaux votent chaque année le tarif du cheval fiscal. Le prix d&rsquo;une carte grise pour un véhicule évolue donc d&rsquo;année en année.</p>



<h3 id="13-payez-en-ligne">Payez en ligne</h3>



<p>A la fin de votre demande de carte grise surDocumentsofficiels.fr, vous payez directement les<strong>&nbsp;taxes&nbsp;</strong>à notre société (Agrément n°26579 du Trésor public). Vous recevez une confirmation de commande et la liste des documents à nous envoyer. La commande&nbsp;<strong>est réalisée en quelques minutes</strong>, en toute facilité !</p>



<h3 id="14-envoyez-vos-documents">Envoyez vos documents</h3>



<p>A réception de votre dossier d’immatriculation, nous procédons aux vérifications nécessaires et à la saisie de vos informations dans le système d’immatriculation de l’Etat (SIV). Si votre dossier est incomplet, nous vous informons par email le jour même. L&rsquo;envoi d&rsquo;un dossier d&rsquo;immatriculation complet facilite le traitement de votre dossier. Vérifiez bien la complétude de votre dossier pour obtenir votre&nbsp;<strong>carte grise en 24h</strong>&nbsp;!</p>



<h3 id="15-recevez-votre-carte-grise">Recevez votre carte grise</h3>



<p>Le jour de la réception de votre dossier d’immatriculation complet, nous vous envoyons un<strong>&nbsp;document officiel</strong>&nbsp;certifiant le changement de titulaire sur le véhicule. Soit l&rsquo;accusé d’enregistrement ou le certificat provisoire, en fonction de votre véhicule. Vous pouvez alors circuler en toute légalité. Sous 2-5 jours, vous recevez votre&nbsp;<strong>carte grise originale</strong>&nbsp;en recommandé directement depuis l’Imprimerie Nationale (cliquez sur le lien pour effectuer le&nbsp;<a href="#/carte-grise/suivi-carte-grise.html">suivi en ligne de votre carte grise</a>).</p>



<div class="wp-block-image"><figure class="aligncenter"><img data-src="https://documentsofficiels.fr/app/App_Resources/accuse-enregistrement-immatriculation.jpg" alt="Accusé d'enregistrement d'un véhicule"/><figcaption>Accusé d&rsquo;enregistrement officiel que vous recevrez par email dès votre démarche effectuée.</figcaption></figure></div>



<div class="wp-block-image"><figure class="aligncenter"><img data-src="https://documentsofficiels.fr/app/App_Resources/cpi-certificat-immatriculation-provisoire.jpg" alt="Certificat provisoire d'immatriculation"/><figcaption>Certificat provisoire d&rsquo;immatriculation que vous recevrez par email dès que votre véhicule sera immatriculé pour la 1ère fois dans le SIV.</figcaption></figure></div>



<h2 id="16-demande-de-carte-grise-avec-eplaque">Demande de carte grise avecDocumentsofficiels</h2>



<p>Avec l&rsquo;introduction du nouveau système d&rsquo;immatriculation SIV le 15 octobre 2009, l&rsquo;État ouvrait la demande de carte grise au secteur privé. Des <strong>prestataires privés habilités</strong> peuvent depuis effectuer les démarches d&rsquo;immatriculation des conducteurs français. Il n&rsquo;était plus obligatoire de passer par la préfecture. Depuis novembre 2017 et la réforme SIV, l&rsquo;immatriculation en préfecture a été remplacée par des procédures dématérialisées (via le <a href="#/carte-grise/ants.html" target="_blank" rel="noreferrer noopener">site de l&rsquo;ANTS</a>, l&rsquo;Agence Nationale des Titres Sécurisés).</p>



<h3 id="17-eplaque-precurseur-de-la-carte-grise-en-ligne-en-france">Documentofficiels, précurseur de la carte grise en ligne en France</h3>



<p><strong>documentsofficiels fut l&rsquo;un des premiers prestataires à proposer la demande de carte grise en ligne en France</strong>. Rapidement rejoint sur ce marché par des concurrents, documentsofficiels se démarque depuis par la fiabilité de ses services et sa rapidité. Ou encore grâce à des plus innovants, comme la possibilité de <strong>payer sa carte grise en 3 fois</strong>. Voyez les évaluations positives de nos clients sur le site indépendant eKomi pour jauger notre sérieux.</p>



<h4 id="h-faire-sa-carte-grise-avec-l-ants">Faire sa carte grise&nbsp;avec l&rsquo;ANTS</h4>



<p>Si la situation commence à s&rsquo;améliorer, la réforme PPNG a engendré des retards dans la gestion des dossiers d&rsquo;immatriculation en 2018. C&rsquo;est ainsi que des médias et organismes tels que 30 Millions de Consommateurs ont recommandé de recourir aux services d&rsquo;un prestataire privé. Ces sociétés agréées sont en effet rodées de longue date à ces procédures. Vous disposez d&rsquo;un <strong>service client réactif et disponible</strong> pour assurer le traitement de votre demande dans les meilleurs délais. Et ce même en cas de dossier complexe (voiture importée, plaques temporaires, etc.).</p>



<h3 id="18-les-differentes-formalites-de-carte-grise">Les différentes formalités de carte grise</h3>



<p>Durant votre vie d&rsquo;automobiliste, différentes démarches vous attendent. A l&rsquo;achat d&rsquo;un véhicule, à un <a href="#/carte-grise/demenagement.html">déménagement</a>, à la vente d&rsquo;un véhicule ou à la perte de la carte grise&#8230; Vous devrez faire une demande de titre. En fonction de la situation, les formalités sont différentes, les papiers à fournir également. Voici les démarches les plus courantes :</p>



<h4 id="h-le-changement-de-titulaire">Le changement de titulaire</h4>



<p>Cette démarche intervient le plus souvent après l&rsquo;achat d&rsquo;un <a href="#/carte-grise/carte-grise-vehicule-occasion">véhicule d&rsquo;occasion</a>. D&rsquo;autres scénarios, comme l&rsquo;héritage d&rsquo;une voiture ou une donation, peuvent également vous obliger à effectuer une demande de&nbsp;<a href="#/carte-grise/changement-titulaire.html">changement de titulaire de la carte grise</a>&nbsp;dans les 30 jours.</p>



<h4 id="h-le-changement-de-domicile">Le changement de domicile</h4>



<p>Suite à un déménagement, vous disposez d&rsquo;un mois pour déclarer votre nouvelle adresse et mettre à jour votre carte grise. Depuis la mise en place du système SIV, la carte grise du véhicule n&rsquo;est plus entièrement remplacée. Seul un autocollant avec la nouvelle adresse est à apposer sur la carte grise du véhicule. En savoir plus sur le&nbsp;<a href="#/carte-grise/changement-adresse">changement d&rsquo;adresse sur une carte grise</a>.</p>



<h4 id="h-l-enregistrement-de-cession">L’enregistrement de cession</h4>



<p>L&rsquo;<a href="#/cession-vehicule/certificat-cession.html">enregistrement de cession</a>, qui se fait via le certificat de cession, est une démarche à faire impérativement lorsque vous vendez un véhicule d&rsquo;occasion (voiture, moto, quad, etc.). En envoyant à la préfecture le&nbsp;<a rel="noopener noreferrer" href="https://documentsofficiels.fr/app/App_Resources/declaration-de-cession-d-un-vehicule-Cerfa-1375401.pdf" target="_blank">formulaire cerfa n° 13754*02</a>&nbsp;rempli par l&rsquo;acheteur, vous vous assurez du transfert automatique du véhicule au nom de l&rsquo;acquéreur, même s&rsquo;il n&rsquo;effectue pas le changement de titulaire sur la carte grise dans les 30 jours comme l’exige la loi. Cette mesure de sécurité vous évitera de recevoir d&rsquo;éventuels PV par la suite.</p>



<h4 id="h-la-demande-de-duplicata-de-carte-grise">La demande de duplicata de carte grise</h4>



<p>Vol, perte, détérioration… De nombreuses péripéties peuvent vous forcer à devoir&nbsp;<a href="#/carte-grise/duplicata-carte-grise.html">demander un duplicata de carte grise</a>. Les démarches à effectuer varient quelque peu en fonction du motif de la demande de duplicata. Voyez nos instructions détaillées pour chaque scénario ci-dessous :</p>



<ul><li>Demande de duplicata en cas de <a href="#/carte-grise/deterioration-carte-grise.html">détérioration de la carte grise</a></li><li><a href="#/carte-grise/perte-carte-grise.html">Duplicata en cas de perte du certificat d&rsquo;immatriculation</a></li><li>Demande de <a href="#/carte-grise/vol-carte-grise.html">duplicata de carte grise en cas de vol</a>&nbsp;</li></ul>



<h2 id="19-vos-questions-sur-les-cartes-grises">Vos questions sur les cartes grises</h2>



<div class="schema-faq wp-block-yoast-faq-block"><div class="schema-faq-section" id="faq-question-1591200638125"><strong class="schema-faq-question">Comment faire sa carte grise en ligne ?</strong> <p class="schema-faq-answer">Vous pouvez faire votre demande en ligne directement sur notre site en moins de 2 minutes. Vous pouvez également faire la demande en ligne sur le site de l&rsquo;ANTS.</p> </div> <div class="schema-faq-section" id="faq-question-1591200654893"><strong class="schema-faq-question">Quel site pour faire sa carte grise ?</strong> <p class="schema-faq-answer">documentsofficiels est la 1ère plateforme d&rsquo;immatriculation depuis 2009. Habilité par l&rsquo;Etat, vous pouvez faire votre commande en toute sécurité.</p> </div> <div class="schema-faq-section" id="faq-question-1591200668602"><strong class="schema-faq-question">Comment faire sa carte grise en ligne gratuitement ?</strong> <p class="schema-faq-answer">Faire sa carte grise en ligne gratuitement est possible, cela dépend de votre démarche, de votre véhicule et de votre domicile.</p> </div> <div class="schema-faq-section" id="faq-question-1591200687895"><strong class="schema-faq-question">Quels papiers faut-il pour faire une carte grise ?</strong> <p class="schema-faq-answer">La liste des documents à fournir est fixée par le Ministère de l&rsquo;Intérieur, retrouvez cette <a href="#/carte-grise/documents-carte-grise.html">liste de documents carte grise ici</a>.</p> </div> <div class="schema-faq-section" id="faq-question-1591200708191"><strong class="schema-faq-question">Comment obtenir rapidement une carte grise ?</strong> <p class="schema-faq-answer">La demande de carte grise s&rsquo;effectue en ligne en moins de 2 minutes. A réception de votre dossier, le traitement est garanti sous 24h pour les dossiers simples.</p> </div> <div class="schema-faq-section" id="faq-question-1603883213909"><strong class="schema-faq-question">Peut-on immatriculer un véhicule au nom d&rsquo;une entreprise individuelle ?</strong> <p class="schema-faq-answer">L’article R. 322-1 du code de la route dispose que : « I. &#8211; Tout propriétaire d&rsquo;un véhicule à moteur […] qui souhaite le mettre en circulation pour la première fois doit faire une demande de certificat d&rsquo;immatriculation en justifiant de son identité et de son domicile […] II.<br/><br/>Lorsque le propriétaire est une personne morale ou une entreprise individuelle, celui-ci doit pouvoir justifier, à la demande du ministre de l&rsquo;intérieur, de son identité et de l&rsquo;adresse de son siège social ou de celle de l&rsquo;établissement d&rsquo;affectation du véhicule ». DSR/SDPUR/BNIV 13/100<br/><br/>Une entreprise individuelle est une entreprise en nom propre qui n&rsquo;a pas la personnalité juridique (article 526-6 du code du commerce et Cour de cassation, 21 avril 2020, n°D19-86.467). Le véhicule affecté à<br/>l&rsquo;entreprise individuelle ne peut être immatriculé qu&rsquo;au nom personnel de l&rsquo;entrepreneur individuel, personne physique.<br/><br/>Pour en savoir plus, nous vous invitons à lire notre page dédiée : <a href="#/carte-grise/immatriculation-entreprise-individuelle">Immatriculation au nom d&rsquo;une entreprise individuelle</a></p> </div> </div>



<h3 id="20-pour-aller-plus-loin">Pour aller plus loin&#8230;</h3>



